'use strict';
class OpenPositionManagerOnInsertAction {
    listener;
    openPositionInfo;
    static create(openPositionInfo) {
        let result;
        result = new OpenPositionManagerOnInsertAction();
        result.openPositionInfo = openPositionInfo;
        return result;
    }
    setListener(listener) {
        this.listener = listener;
    }
    execute() {
        this.listener.onAdd(this.openPositionInfo);
    }
}
module.exports = OpenPositionManagerOnInsertAction
